import React from 'react';
import {Box, Button, ButtonGroup, Flex, Heading, HStack, Text, VStack} from "@chakra-ui/react";

const FoundQuiz = () => {
    return (
        <Box bg={'gray.100'} minH={'100vh'}>
            <Flex w={'100%'} direction={'column'}>
                <Box>
                    <VStack pt={10} spacing={4}>
                        {/*    OPTIONS*/}
                        <Box w={500} minW={200} bg={'white'} p={10}>
                            <VStack bg={'red'} justifyContent={'start'}>
                                <Heading fontSize={20}> Question title</Heading>
                                <HStack>
                                    <Text>10 Questions</Text>
                                </HStack>
                            </VStack>
                        </Box>
                        {/*  QUIZ TITLE*/}
                        {/*  ACTION BUTTONS*/}
                        <VStack w={500} p={10} bg={'white'} minW={'200px'} spacing={8}>
                            <Button size={'lg'} w={'100%'} colorScheme={'teal'}>Start</Button>
                            <Button size={'lg'} w={'100%'} colorScheme={'blue'}>Share</Button>
                            <Button size={'lg'} w={'100%'} colorScheme={'gray'}>Cancel</Button>
                        </VStack>

                    </VStack>
                </Box>
            </Flex>
        </Box>
    );
};

export default FoundQuiz;
